    "2015-09-01T18:09:05.047728",nt"name": "cost-of-living-adjustment-cola-information",nt"isopen":
    true,nt"url": null,nt"notes": "We adjust SNAP maximum allotments, deductions,
    and income eligibility standards at the beginning of each Federal fiscal year. The
    changes are based on changes in the cost of living. COLAs take effect on October
    1 each year.rnrnMaximum allotments are calculated from the cost of a market basket
    based on the Thrifty Food Plan for a family of four, priced in June that year. The
    maximum allotments for households larger and smaller than four persons are determined
    using formulas that account for economies of scale. Smaller households get slightly
    more per person than the four-person household. Larger households get slightly less.rnrnIncome
    eligibility standards are set by law. Gross monthly income limits are set at 130
    percent of the poverty level for the household size. Net monthly income limits are
    set at 100 percent of poverty.",nt"license_title": "Creative Commons CCZero",nt"extras":
